import React, { Component } from 'react'
import { Box, TextField } from '@material-ui/core';

const styles = {
    container: {
        display: 'flex',
        flexWrap: 'wrap',
    },
    textField: {
        width: 300,
        margin: 100,
    },
    //style for font size
    resize: {
        fontSize: 50
    },
}

export default class DescriptionField extends Component {
    render() {
        return (
            <Box style={{ width: '100%', height: '100%', backgroundColor: "red" }}>
                <TextField id="with-placeholder"
                    label="Add id"
                    placeholder="id"
                    InputProps={{
                        classes: {
                            input: styles.resize,
                        },
                    }}
                    className={styles.textField}
                    margin="normal"
                    autoFocus={true}
                    helperText={"Add an existing id or select "} /> />
            </Box>

        )
    }
}
